/*===== PayPal Form Validation =====*/
function IsEmailValid(Temp)
{
	var EmailOk  = true;
	var AtSym    = Temp.indexOf('@');
	var Period   = Temp.lastIndexOf('.');
	var Space    = Temp.indexOf(' ');
	var Length   = Temp.length - 1;   // Array is from 0 to length-1

	if ((AtSym < 1) ||                     // '@' cannot be in first position
  	  (Period <= AtSym+1) ||             // Must be atleast one valid char btwn '@' and '.'
    	(Period == Length ) ||             // Must be atleast one valid char after '.'
	    (Space  != -1))                    // No empty spaces permitted
	  {  
  		EmailOk = false;
	  }
	
	return EmailOk;
}

function form_chk()
{
	error = "Please enter the following information:\n";
	error_parts="";
	gender_check = 0;
	obj=document.forms["paypalForm"];

	var inv_no=obj.invNo.value;
	var email_chk=IsEmailValid(obj.os5.value);

	if(obj.invNo.value=="")
		error_parts = error_parts + "- Invoice No\n";
	else if (isNaN(inv_no)==true)
		error_parts = error_parts + "- Your Invoice No should contain only digits\n";
	else if (inv_no.length!=8)
		error_parts = error_parts + "- Your Invoice No should contain 8 digits\n";
	else
		obj.item_number.value=obj.invType.value+obj.invNo.value;
	
	if(obj.amount.value=="")
		error_parts = error_parts + "- Invoice Amount\n";
	
	if(obj.os1.value=="")
		error_parts = error_parts + "- SCP No\n";
	
	if(obj.os2.value=="")
		error_parts = error_parts + "- Customer Name\n";
	
	if(obj.os3.value=="")
		error_parts = error_parts + "- Paypal Name/Email\n";
		
	if(obj.os4.value=="")
		error_parts = error_parts + "- Contact No\n";
	
	if(obj.os5.value=="")
		error_parts = error_parts + "- Email Address\n";
	else if(email_chk==false)
		error_parts = error_parts + "- Correct Email Format\n";

	if (error_parts != ""){
		alert(error + error_parts);
		return false;
	}
	else
	{
		return true;
	}
}

